import React from 'react'

const Category = () => {
  return (
    <div className='btn_group'>
        <button className='btn_css'>All</button>
        <button className='btn_css'>Breakfast</button>
        <button className='btn_css'>Lunch</button>
        <button className='btn_css'>Dinner</button>
    </div>
  )
}

export default Category
